import React, { useContext, useEffect, useState } from "react";
import { Container, Row, Button, Modal, Form, Dropdown } from "react-bootstrap";
import { TransactionContext } from "./transaction-context";
import TransactionList from "./transaction-list";
import AddTransactionForm from "./add-transaction-form";

export default function TransactionPage() {
  const {
    state,
    fetchUserAccounts,
    fetchAccountDetails,
    fetchTransactions,
    handleInputChange,
    handleSubmit,
  } = useContext(TransactionContext);
  const [showModal, setShowModal] = useState(false);
  const [selectedAccount, setSelectedAccount] = useState(null);

  const handleCloseModal = () => setShowModal(false);
  const handleShowModal = () => setShowModal(true);

  useEffect(() => {
    const userString = localStorage.getItem("user");
    if (userString) {
      const user = JSON.parse(userString);
      console.log("User ID from localStorage:", user.id);
      fetchUserAccounts(user.id);
    }
  }, [fetchUserAccounts]);

  const handleAccountChange = (e) => {
    const accountId = e.target.value;
    setSelectedAccount(accountId);
    console.log("Selected Account ID:", accountId);
    fetchAccountDetails(accountId);
    fetchTransactions(accountId);
  };

  return (
    <Container style={{ marginTop: "70px" }}>
      <h1>Transaction Management</h1>
      <Form.Group>
        <Form.Label>Select Account</Form.Label>
        <Form.Control as="select" onChange={handleAccountChange}>
          <option value="">Select an account</option>
          {state.accounts.map((account) => (
            <option key={account.accountId} value={account.accountId}>
              {account.accountName}
            </option>
          ))}
        </Form.Control>
      </Form.Group>
      {selectedAccount && (
        <>
          <h2>Account Details</h2>
          <p>
            <strong>Name:</strong> {state.selectedAccount.accountName}
          </p>
          {state.selectedAccount.balance && (
            <p>
              <strong>Balance:</strong> {state.selectedAccount.balance}
            </p>
          )}
          {state.selectedAccount.apr && (
            <p>
              <strong>APR:</strong> {state.selectedAccount.apr}
            </p>
          )}
          {state.selectedAccount.accountType && (
            <p>
              <strong>Type:</strong> {state.selectedAccount.accountType}
            </p>
          )}
          {state.selectedAccount.creditLimit && (
            <p>
              <strong>Credit Limit:</strong> {state.selectedAccount.creditLimit}
            </p>
          )}
          {state.selectedAccount.loanDisbursementDate && (
            <p>
              <strong>Loan Disbursement Date:</strong>{" "}
              {state.selectedAccount.loanDisbursementDate}
            </p>
          )}
          {state.selectedAccount.loanRepaymentDate && (
            <p>
              <strong>Loan Repayment Date:</strong>{" "}
              {state.selectedAccount.loanRepaymentDate}
            </p>
          )}
          {state.selectedAccount.minMonthlyPayment && (
            <p>
              <strong>Min Monthly Payment:</strong>{" "}
              {state.selectedAccount.minMonthlyPayment}
            </p>
          )}
          {state.selectedAccount.principal && (
            <p>
              <strong>Principal:</strong> {state.selectedAccount.principal}
            </p>
          )}

          <TransactionList transactions={state.transactions} />

          <Button variant="primary" onClick={handleShowModal}>
            Add New Transaction
          </Button>
          <Modal show={showModal} onHide={handleCloseModal}>
            <Modal.Header closeButton>
              <Modal.Title>Add New Transaction</Modal.Title>
            </Modal.Header>
            <Modal.Body>
              <AddTransactionForm
                newTransaction={state.newTransaction}
                handleInputChange={handleInputChange}
                handleSubmit={(e) => {
                  handleSubmit(e);
                  handleCloseModal();
                }}
              />
            </Modal.Body>
          </Modal>
        </>
      )}
    </Container>
  );
}
